    inline void set_ICSR(bool NMIPENDSET, bool PENDSVSET,
                         PPB_ICSR_PENDSVCLR PENDSVCLR,
                         PPB_ICSR_PENDSTSET PENDSTSET,
                         PPB_ICSR_PENDSTCLR PENDSTCLR) volatile
    {
        uint32_t curr = ICSR;

        curr &= ~(0b1u << 31u);
        curr |= (NMIPENDSET & 0b1u) << 31u;
        curr &= ~(0b1u << 28u);
        curr |= (PENDSVSET & 0b1u) << 28u;
        curr &= ~(0b1u << 27u);
        curr |= (std::to_underlying(PENDSVCLR) & 0b1u) << 27u;
        curr &= ~(0b1u << 26u);
        curr |= (std::to_underlying(PENDSTSET) & 0b1u) << 26u;
        curr &= ~(0b1u << 25u);
        curr |= (std::to_underlying(PENDSTCLR) & 0b1u) << 25u;

        ICSR = curr;
    }

