        ASPEN = PPB_FPCCR_ASPEN(curr & (1u << 31u));
        LSPEN = PPB_FPCCR_LSPEN(curr & (1u << 30u));
        MONRDY = PPB_FPCCR_MONRDY(curr & (1u << 8u));
        BFRDY = PPB_FPCCR_BFRDY(curr & (1u << 6u));
        MMRDY = PPB_FPCCR_MMRDY(curr & (1u << 5u));
        HFRDY = PPB_FPCCR_HFRDY(curr & (1u << 4u));
        THREAD = PPB_FPCCR_THREAD(curr & (1u << 3u));
        USER = PPB_FPCCR_USER(curr & (1u << 1u));
        LSPACT = PPB_FPCCR_LSPACT(curr & (1u << 0u));
